import React from 'react';
import spinner from './Spinner.gif'

export default () => {
    return (
        <div>
            <img 
                src={spinner}
                alt="Loading..."
                style={{  width:'200px' , margin:'40px' , alignItems:'center' , display:'block'  }}
            />
        </div>
    )
}
